import React from 'react';

function NoteList({ notes, onDelete }) {
  return (
    <div>
      <h2>Note List</h2>
      <ul>
        {notes.map((note) => (
          <li key={note.id}>
            {note.studentName} - {note.grade}
            <button onClick={() => onDelete(note.id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default NoteList;
